import React, { useEffect, useState } from 'react';

interface courseResult {
    subject: string;
    code: string;
    title: string
    description: string;
}




export const Home = (): JSX.Element => {
    const [courseResult, setCourseResult] = useState<courseResult | undefined>();
    useEffect(() => {
        fetch('http://localhost:5000')
        .then((response) => response.json())
        .then((json) => setCourseResult(json));
    }, []);

    return (
        <section className="bg-gray-900 text-white py-16">
            <div className="container mx-auto px-4">
                <h1 className="text-4xl font-bold mb-4">Course Search</h1>
                <p className="text-lg mb-8">Enter a query for courses:</p>

                <button className="bg-blue-500 hover:bg-blue-600 text-white px-6 py-3 rounded-md">
                Generate courses
                </button>
            </div>
        </section>
    )
}
